import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import Home from 'src/views/home/HomeView';
import React, { lazy } from 'react';

const App = () => {
  const OtherComponent = lazy(() => import('src/views/home/HomeView'));

  return (
    <BrowserRouter>

      <Routes>
        <Route path="/" element={<OtherComponent />} />

      </Routes>
    </BrowserRouter>
  );
}

export default App;
